import { Text, View, StyleSheet } from 'react-native'
import DomainName from '../components/DomainName'
import Logo from '../components/Logo'

const HomeScreen = () => {
    return (
        <View>
            <Logo />
            <DomainName />
            <FrontImage />
        </View>
    )
}

const styles = StyleSheet.create({

})

export default HomeScreen
